	(1, 'Global estimates', 'MENU', NULL, 'MENU_ITEM'),
	(2, 'EU estimates', 'MENU', NULL, 'MENU_ITEM'),
	(3, 'EU countries comparison', 'MENU', NULL, 'MENU_ITEM'),
