	(7, 'Site map', 'FOOTER', NULL, 'FOOTER_ITEM'),
	(8, 'Privacy notice', 'FOOTER', NULL, 'FOOTER_ITEM'),
	(9, 'Legal notice', 'FOOTER', NULL, 'FOOTER_ITEM'),
	(10, 'Accessibility', 'FOOTER', NULL, 'FOOTER_ITEM'),
	(11, 'Contact us', 'FOOTER', NULL, 'FOOTER_ITEM'),
	(12, 'Global estimates', 'HOMEPAGE', NULL, 'OTHER_LITERAL'),
	(13, 'EU28 estimates', 'HOMEPAGE', NULL, 'OTHER_LITERAL'),
	(14, 'Cost to society of work-related injury and illness', 'HOMEPAGE', '3', 'SHORT_TITLE'),
	(15, 'Cost to society of work-related injury and illness', 'HOMEPAGE', '3', 'LONG_TITLE'),
	(16, 'Work-related injuries and illnesses result in the loss of 3.7% of all work-years globally and 3.2% of those in the EU, equivalent to a cost of  approximately 2,247 billion and 495 billion, respectively.', 'HOMEPAGE', '3', 'RELATED_MESSAGE_$'),
	(17, 'Work-related injuries and illnesses result in the loss of 3.7% of all work-years globally and 3.2% of those in the EU, equivalent to a cost of  approximately 2,206 billion and 446 billion, respectively.', 'HOMEPAGE', '3', 'RELATED_MESSAGE_€'),
	(18, 'Mortality: deaths resulting from work-related injury and illness (number of fatalities)', 'HOMEPAGE', '6', 'SHORT_TITLE'),
	(19, 'Mortality: deaths resulting from work-related injury and illness (number of fatalities)', 'HOMEPAGE', '6', 'LONG_TITLE'),
	(20, 'Work-related illnesses account for 86% of all deaths related to work globally and 98% in the EU.', 'HOMEPAGE', '6', 'RELATED_MESSAGE'),
	(21, 'DALY (disability-adjusted life years) lost due to work-related injury and illness (millions of years)', 'HOMEPAGE', '9', 'SHORT_TITLE'),
	(22, 'DALY (disability-adjusted life years) lost due to work-related injury and illness (millions of years)', 'HOMEPAGE', '9', 'LONG_TITLE'),
	(23, 'In total, 115.5 million DALY are lost globally as a result of work-related injury and illness and 6,8 million in the EU. 67.3 million of these are years of life lost due to fatal injury or illness (3.4 million in the EU) and 48.2 million are lived with disability (3.4 million in the EU).', 'HOMEPAGE', '9', 'RELATED_MESSAGE'),
	(24, 'YLL', 'HOMEPAGE', '9', 'LITERAL_AXIS'),
	(25, 'YLD', 'HOMEPAGE', '9', 'LITERAL_AXIS'),
	(26, 'Percentage of all work-related deaths', 'HOMEPAGE', '11', 'SHORT_TITLE'),
	(27, 'Percentage of all work-related deaths', 'HOMEPAGE', '11', 'LONG_TITLE'),
	(28, 'What are the main work-related illnesses and injuries resulting in death and in DALY?', 'HOMEPAGE', '12', 'TITLE'),
	(29, '* Deaths due to MSDs are included in `Other´ illnesses', 'HOMEPAGE', '12', 'OTHER_LITERAL'),
	(30, 'Percentage of all work-related DALY', 'HOMEPAGE', '14', 'SHORT_TITLE'),
	(31, 'Percentage of all work-related DALY', 'HOMEPAGE', '14', 'LONG_TITLE'),
	(32, 'What are the main work-related illnesses and injuries resulting in death and in DALY?', 'HOMEPAGE', '15', 'TITLE'),
	(33, 'Cancer is the biggest killer with 106,307 fatal cases per year in EU28, followed by Circulatory illnesses with 49,462 cases. Also, Cancer has the highest DALY (Years of Life Lost or Years Lived with Disability).', 'HOMEPAGE', '15', 'RELATED_MESSAGE'),
	(34, 'See more about work-related illnesses groups', 'HOMEPAGE', NULL, 'BUTTON'),
	(35, 'Compare the situation in the WHO regions', 'HOMEPAGE', NULL, 'BUTTON'),
	(36, 'Compare the situation in EU countries', 'HOMEPAGE', NULL, 'BUTTON'),
	(37, 'WHO regions and EU28 average comparison', 'WHO_REGIONS', NULL, 'SECTION_TITLE'),
	(38, 'In HIGH and AMRO the cost of non-fatal work-related injury and illness is higher than the fatal ones. Consequently, the number of Years of Lived with Disability (YLD) is higher than the Years of Life Lost (YLL).', 'WHO_REGIONS', NULL, 'INTRO'),
	(39, 'See more about the estimates', 'WHO_REGIONS', NULL, 'BUTTON'),
	(40, 'Mortality', 'WHO_REGIONS', '16', 'CARROUSEL_TITLE'),
	(41, 'Years of life lost', 'WHO_REGIONS', '17', 'CARROUSEL_TITLE'),
	(42, 'Years of Life Lost vs Years Lived with Disability', 'WHO_REGIONS', '18', 'CARROUSEL_TITLE'),
	(43, 'Total cost', 'WHO_REGIONS', '21', 'CARROUSEL_TITLE'),
	(44, 'Select a country to find out the region it belongs to:', 'WHO_REGIONS', NULL, 'OTHER_LITERAL'),
	(45, 'See more about the situation in the European countries', 'WHO_REGIONS', NULL, 'BUTTON'),
	(46, 'See more about the main work-related illnesses groups in the EU countries', 'WHO_REGIONS', NULL, 'BUTTON'),
	(47, 'Mortality: deaths per 100,000 workers', 'WHO_REGIONS', '16', 'SHORT_TITLE'),
	(48, 'Mortality: deaths per 100,000 workers', 'WHO_REGIONS', '16', 'LONG_TITLE'),
	(49, 'The mortality rate (deaths resulting from work-related injury and illness per 100,000 workers) ranges from 56 cases in AMRO to 109 cases in EURO per 100,000 workers (93 in the EU28). 80%-98% are due to work-related illness.', 'WHO_REGIONS', '16', 'RELATED_MESSAGE'),
	(50, 'Years of Life Lost (YLL) resulting from fatal cases per 100.000 workers', 'WHO_REGIONS', '17', 'SHORT_TITLE'),
	(51, 'Years of Life Lost (YLL) resulting from fatal cases per 100.000 workers', 'WHO_REGIONS', '17', 'LONG_TITLE'),
	(52, 'The rate of years of Life Lost (YLL per 100,000 workers) due to work-related injury and illness ranges from 1,266 years in AMRO to 2,775 years in SEARO per 100.000 workers (1,561 in the EU28).', 'WHO_REGIONS', '17', 'RELATED_MESSAGE'),
	(53, 'Total years lost: Comparison of Years of Life Lost (YLL) and Years Lived with Disability (YLD)', 'WHO_REGIONS', '18', 'SHORT_TITLE'),
	(54, 'Total years lost: Comparison of Years of Life Lost (YLL) and Years Lived with Disability (YLD)', 'WHO_REGIONS', '18', 'LONG_TITLE'),
	(55, 'In HIGH and AMRO, more years are lived with disability (YLD) than are lost due to early death (YLL). In the EU28, YLD accounts for 50% and YLL for 50%.', 'WHO_REGIONS', '18', 'RELATED_MESSAGE'),
	(56, 'Cost to society in terms of DALY rate (years per 100,000 workers) and in terms of contribution to work-years lost expressed as percentage equivalent of total GDP (%)', 'WHO_REGIONS', '21', 'SHORT_TITLE'),
	(57, 'Cost to society in terms of DALY rate (years per 100,000 workers) and in terms of contribution to work-years lost expressed as percentage equivalent of total GDP (%)', 'WHO_REGIONS', '21', 'LONG_TITLE'),
	(58, 'Disability Adjusted Life Years (DALY) is the sum of Years of Life Lost (YLL) due to work-related death and Years Lived with Disability (YLD) due to work-related injury and illness. DALY rate (years per 100.000 workers) varies from 3,190 years in WPRO to 4,397 years in SEARO (3,109 in the EU28). \r\nThe total cost can be expressed as DALY rate or contribution to work-years lost expressed as percentage equivalent of total GDP (%). In this sense, the workyears loss ranges from 3.19% in WPRO to 4.40% in SEARO.', 'WHO_REGIONS', '21', 'RELATED_MESSAGE'),
	(59, 'EU countries comparison', 'EU_COMPARISON', NULL, 'SECTION_TITLE'),
	(60, '3.1% of the GDP work-years are lost due to work-related injury and illness. The majority is due to work-related illnesses reaching the 3,0% of the GDP workyears.', 'EU_COMPARISON', NULL, 'INTRO'),
	(61, 'See more about the estimates', 'EU_COMPARISON', NULL, 'BUTTON'),
	(62, 'Years of life lost', 'EU_COMPARISON', '22', 'CARROUSEL_TITLE'),
	(63, 'Years lived with disability', 'EU_COMPARISON', '23', 'CARROUSEL_TITLE'),
	(64, 'Total years lost', 'EU_COMPARISON', '24', 'CARROUSEL_TITLE'),
	(65, 'Total GDP workyears lost', 'EU_COMPARISON', '25', 'CARROUSEL_TITLE'),
	(66, 'From work-related injuries', 'EU_COMPARISON', '26', 'CARROUSEL_TITLE'),
	(67, 'From work-related illnesses', 'EU_COMPARISON', '27', 'CARROUSEL_TITLE'),
	(68, 'See more about work-related illnesses groups in the EU countries', 'EU_COMPARISON', NULL, 'BUTTON'),
	(69, 'See more about the situation at world level, in the WHO regions', 'EU_COMPARISON', NULL, 'BUTTON'),
	(70, 'Years of Life Lost (YLL) per 100,000 workers', 'EU_COMPARISON', '22', 'SHORT_TITLE'),
	(71, 'Years of Life Lost (YLL) per 100,000 workers', 'EU_COMPARISON', '22', 'LONG_TITLE'),
	(72, 'The rate of years of Life Lost (YLL per 100,000 workers) due to work-related injury and illness ranges from 1,256 years in United Kingdom to 2,617 years in Bulgaria per 100.000 workers (1,562 in the EU28).', 'EU_COMPARISON', '22', 'RELATED_MESSAGE'),
	(73, 'Years lived with disability (YLD) per 100,000 workers', 'EU_COMPARISON', '23', 'SHORT_TITLE'),
	(74, 'Years lived with disability (YLD) per 100,000 workers', 'EU_COMPARISON', '23', 'LONG_TITLE'),
	(75, 'The rate of years of Lived with Disability (YLD per 100,000 workers) due to work-related injury and illness ranges from 795 years in Estonia to 4,004 years in Iceland per 100.000 workers (1,547 in the EU28).', 'EU_COMPARISON', '23', 'RELATED_MESSAGE'),
	(76, 'Total years lost: Disability adjusted life years (DALY) per 100,000 workers', 'EU_COMPARISON', '24', 'SHORT_TITLE'),
	(77, 'Total years lost: Disability adjusted life years (DALY) per 100,000 workers', 'EU_COMPARISON', '24', 'LONG_TITLE'),
	(78, 'Disability Adjusted Life Years (DALY) is the sum of Years of Life Lost (YLL) due to work-related death and Years Lived with Disability (YLD) due to work-related injury and illness. DALY rate (years per 100.000 workers) varies from 2,201 years in United Kingdom to 5,409 years in Iceland (3,109 in the EU28).', 'EU_COMPARISON', '24', 'RELATED_MESSAGE'),
	(79, 'Cost expressed as proportion of all work-years lost expressed as percentage equivalent of total GDP (%)', 'EU_COMPARISON', '25', 'SHORT_TITLE'),
	(80, 'Cost expressed as proportion of all work-years lost expressed as percentage equivalent of total GDP (%)', 'EU_COMPARISON', '25', 'LONG_TITLE'),
	(81, 'The total cost can be expressed as DALY rate or as contribution to work-years lost expressed as percentage equivalent of total GDP (%). In this sense, the workyears loss ranges from 2.20% in United Kingdom to 5.41% in Iceland (3.11% in the EU28).', 'EU_COMPARISON', '25', 'RELATED_MESSAGE'),
	(82, 'Work-related injury contribution to total GDP work-years lost', 'EU_COMPARISON', '26', 'SHORT_TITLE'),
	(83, 'Work-related injury contribution to total GDP work-years lost', 'EU_COMPARISON', '26', 'LONG_TITLE'),
	(84, 'Work-related injuries contribution to the work-years lost ranges from 0.04% in Netherlands to 0.48% in Luxembourg (0.14% in the EU28).', 'EU_COMPARISON', '26', 'RELATED_MESSAGE'),
	(85, 'Work-related illness contribution to total GDP work-years lost (%)', 'EU_COMPARISON', '27', 'SHORT_TITLE'),
